import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";


contract Exchange {
    IUniswapV2Router02 public uniswapRouter;
    IERC20 public usdcToken;

    constructor() {
        uniswapRouter = IUniswapV2Router02(0xa5E0829CaCEd8fFDD4De3c43696c57F7D7A678ff);
        usdcToken = IERC20(0x2791Bca1f2de4661ED88A30C99A7a9449Aa84174);
    }

    function swapETHForUSDC(uint amountOutUSDC) external payable {
        // Approve the Uniswap router to spend ETH
        // uniswapRouter.approve(address(uniswapRouter), msg.value);

        // Define the path for the swap: ETH -> WETH -> DAI
        address[] memory path = new address[](2);
        path[0] = uniswapRouter.WETH();
        path[1] = address(usdcToken);

        // Perform the swap
        uint[] memory amounts = uniswapRouter.swapETHForExactTokens{value: msg.value}(
            amountOutUSDC,
            path,
            msg.sender,
            block.timestamp + 300 // Deadline is 5 minutes from now
        );

        // Retrieve the amount of ETH actually spent in the swap
        uint ethSpent = amounts[0];

        // If there is any ETH left over, refund it to the caller
        if (msg.value > ethSpent) {
            payable(msg.sender).transfer(msg.value - ethSpent);
        }
    }
}

